[CmdletBinding()]
Param(
    [parameter(Mandatory = $true, ValueFromPipeline = $true)][string]$line
)

#####################################################
### Ed-Fi ODS v3+
### Assessment: Sample Test 
### Script: Custom File Processor
#####################################################


# Handle start of processing
begin {

    # Set up the statistics
    # validations: Hashtable of HashTables with properties for each screening period, and each screening period will have statistics like number of records not loaded, and detailed info
    <#
    #>
    $global:statistics = @{
        "rowsProcessed" = 0
        "rowsLoaded"    = 0
        "validations"   = @{}
    }

    # Prepare some other variables
    $currentLineNumber = 0
    $global:inputHeaders = @()
    $global:headersLookup = @{}

    ### Helper functions

    ## ODS functions
    
    function Get-Students ($apiVersion) {
        <#
            .SYNOPSIS
                Load all students and their assocaited ID values from the ODS 

            .DESCRIPTION
                Loads StudentUniqueId, First Name, Last Name, Date of Birth, and all other Student ID values
                from the ODS. This data can then be used to look up a StudentUniqueId value by any ID or by
                FN/LN/DoB.

            .PARAMETER ApiVersion
                The version number of the API as set in $DataImport.ApiVersion. For whatever reason the $DataImport
                object is not directly addressable from within a module.

            .OUTPUTS
                A complex HashMap of values that you can treat as an object. The format is:
                - ValidStudents: Hashmap of Hashmaps
                    - Student Records (Key: StudentUniqueId; Values: StudentUniqueId, FirstName, LastSurname, birthDate, DistrictId, StateId)
                - DuplicateStudents: Array of Hashmaps
                    - Student Records (Values: StudentUniqueId, FirstName, LastSurname, DateofBirth, DistrictId, StateId) 
                - NoAdditionalIdValuesFoundCount: Integer (v3 API only). Additional StudentID values have to be looked up in the 
                    StudentEducationOrganizationAssociations entity and we have seen cases where there is not a matching record in
                    this entity for the one in the Students entity. In this case this value is incremented and the Student entry in 
                    the ValidStudents Hashmap will be missing the DistrictId and StateId values.

                Throws an error on any failure to connect to or query the API or if one or more students of
                the 10 checked have a different ID value type (e.g. one has 'District' while the rest have 
                'State')

            .EXAMPLE
                $students = Get-Students -apiVersion $DataImport.ApiVersion
        #>

        # Set up some basic varialbes
        $ret = @{"ValidStudents" = @{}
                "DuplicateStudents" = @()
                "NoAdditionalIdValuesFound" = 0
                }
        $continue = $true
        $offset = 0
        $limit = 100

        # Do sanity checks on parameters
        if (!$apiVersion) { throw "The apiVersion parameter must be set to a valid value." }

        # Processing depends on the API version
        if ($apiVersion.StartsWith("3.") -or $apiVersion.StartsWith("5.") -or $apiVersion.StartsWith("6.")) {
            # Load all students (but not their ID values - that's the second pass)
            try {
                while ($continue) { 
                    $jsonResponse = Invoke-OdsApiRequest -RequestPath "/ed-fi/students?offset=$offset&limit=$limit"
                    $students = ConvertFrom-Json $jsonResponse
                    
                    # Process the students
                    if ($students.Count -gt 0) {
                        foreach ($student in $students) {
                            # Capture the basic student data
                            # $d = Get-ParsedDate -date $student.birthDate -inputFormat "yyyy-MM-ddTHH:mm:ss" -outputFormat "M/d/yyyy"
                            $s = @{
                                "studentUniqueId" = $student.studentUniqueId
                                "firstName" = $student.firstName
                                "lastSurname" = $student.lastSurname
                                "birthDate" = $student.birthDate
                            }

                            # Check to see if the student is already in the list (this shouldn't happen but we've seen it in the past)
                            if ($ret.ValidStudents[$student.studentUniqueId]) {
                                # studentUniqueId value is already present in the list of students and this record should be added ot the DuplicateStudents array
                                $ret.DuplicateStudents += $s
                            }
                            else {
                                # Student is unique and should be added to the ValidStudents HashMap
                                $ret.ValidStudents.Add($student.studentUniqueId, $s) | Out-Null
                            }
                        }
                    }
                    else {
                        $continue = $false
                    }
                    $offset += $limit
                }
                
                # Return the data
                return $ret
            }
            catch {
                throw $_
            }
        }
        else { 
            throw "Attempt to connect to a version $($apiVersion) API, which is unsupported."    
        }
        

    }
        
    function Get-StudentUniqueId($studentList, $firstName, $lastSurname, $birthDate) {
        <#
            .SYNOPSIS
                Return the appropriate studentUniqueId value for a student based on First Name, Last Name, and Date of Birth. 

            .DESCRIPTION
                Looks up the studentUniqueId student using First Name, Last Name, and Birth Date (all three are required)

            .PARAMETER studentList (required)
                Hashmap of student information with the studentUniqueId value as key. The easiest way to get this data
                is to call Get-Students and then pass  the "ValidStudents" hashmap that is returnd as part of the function
                data to this function.

            .PARAMETER firstName (required)
                If provided, this will also be used to look up a studentUniqueId value. If you include this parameter then 
                you must also include lastSurname and birthDate.

            .PARAMETER lastSurname (required)
                If provided, this will also be used to look up a studentUniqueId value. If you include this parameter then 
                you must also include firstName and birthDate.

            .PARAMETER birthDate (required)
                If provided, this will also be used to look up a studentUniqueId value. If you include this parameter then 
                you must also include firstName and lastSurname.

            .OUTPUTS
                A studentUniqueId value that is valid for the ODS in use if successful.
                
                Throws an error if no matching StudentUniqueId value can be found for any number of reasons.

                Throws an error if more than one student is matched using either ID or FN/LN/DoB searches

                Throws an error on any other condition.

            .EXAMPLE
                $studentUniqueId = Get-StudentUniqueId -studentList $studentList -studentId $studentId -firstName $firstName -lastSurname $lastSurname -birthDate $birthDate
        
        #>

        # Do some sanity checks on the parameters
        if (!$studentList) { throw "A list of students must be provided for -studentList" }
        if ($firstName -or $lastSurname -or $birthDate) {
            if (!$firstName) { throw "A value must be provided for -firstName if one is provided for either -lastSurname or -birthDate" }
            if (!$lastSurname) { throw "A value must be provided for -lastSurname if one is provided for either -firstName or -birthDate" }
            if (!$birthDate) { 
                throw "A value must be provided for -birthDate if one is provided for either -firstName or -lastSurnames" 
            }
        }
        
        # Do a FN/LN/DOB lookup
        if ($firstName -and $lastSurname -and $birthDate) {
            $ret = $null
            $matchCount = 0
                foreach ($student in $studentList.Values) {
                if ($firstName.ToLower() -eq $student.firstName.ToLower() -and $lastSurname.ToLower() -eq $student.lastSurname.ToLower() -and $birthDate -eq $student.birthDate) {
                    $ret = $student.studentUniqueId 
                    $matchCount ++
                }
            }
            if ($ret) { 
                if ($matchCount -eq 1) { return $ret }
                else {
                    throw "Found more than one Student entry with a name of '$firstName $lastSurname' and a birthdate of '$birthDate'."
                }
            }
        }

        # No ID found so return null
        Write-Information "Unable to find a matching StudentUniqueID value for Student ID '$studentId'"
    }
    ## Helper functions        

    # Convert an array list of data into a CSV line for output
    function Get-CSVLine($inputData) {
        $ret = ""
        foreach ($cell in $inputData) {
            if ($ret -ne "") { $ret += "," }
            $ret += ('"' + $cell + '"')
        }
        return $ret
    }
    function Get-ParsedRecordArray($line) {
        # Deal with double-quote wrappers and the fact that fields may have embedded commas
        # NOTE: This is vastly stupid, but we can't run Regex in ConstrainedLanguage mode so it is what it is.
        if ($line.Contains('","') -or $line.Contains(',"') -or $line.Contains('",')) {
            $cleanLine = $line
            $inQuote = $false
            for ($i = 0; $i -le $cleanLine.length; $i++) {
                if ($cleanLine[$i] -eq '"') {
                    $inQuote = !$inQuote
                }
                else {
                    if ($cleanLine[$i] -eq "," -and $inQuote -eq $false) {
                        $cleanLine = $cleanLine.Substring(0, $i) + "^" + $cleanLine.Substring($i + 1)
                    }
                }
            }
            $cleanLine = $cleanLine.Replace(",", "")
            $fields = $cleanLine.split("^")
        }
        else {
            $fields = $line.split(",")
        }
        $ret = @()
        for ($i = 0; $i -lt $fields.Length; $i++) {
            $ret += $fields[$i].Replace('"', '')
        }
        return $ret
    }
    # Parse Date from string
    function Get-ParsedDate ($date, $inputFormat, $outputFormat = $null) {
        <# 
            .SYNOPSIS
                Parse a date string and returns it in the correct format.
    
            .PARAMETER date (required)
                The date string to parse
    
            .PARAMETER inputFormat (required)
                The expected format of the incoming date string
    
            .PARAMETER outputFormat (optional)
                The desired format of the retured date string
    
            .OUTPUTS
                If no outputFormat is provided then a Date object is returned
    
                If outputFormat is provided then a formatted string is returned
    
                If parsing fails for any reason then $null is returned
        #>
    
        try {
            $d = $([datetime]::ParseExact($date, $inputFormat, $null))
            if ($outputFormat) {
                $d = Get-Date -Date $d -Format $outputFormat
            }
            return $d
        }
        catch {
            return $null
        }
    }
    
    # Function to perform a single lookup.
    function get-replacement($original){
        if($original -eq 'Y'){
            return "true"
        }else{
            if($original -eq 'N'){
                return "false"
            }
        }
        
        ##should not get here
        return $null
    }
    
    ### Assessment fields

    $global:fileColumnDelimiter = ","

    # Namespace to performace level
    $AssessNamespace = "uri://collegeboard.org"

    #The script expects the $DataImport.MapAttribute to be supplied (SAT or PSAT) to find the source column name and create the DI column
    $testDateColumnName = "LATEST_{0}_DATE" -f $($DataImport.MapAttribute)
    $DItestDateColumnName = "DI_SchoolYear_{0}" -f $testDateColumnName
    $DIAssessIdentifierColumnName = "DI_StudentAssessmentIdentifier_{0}" -f $testDateColumnName
    

    # Custom/computed output columns. key: output column name, value: HashTable with source column name and other info
    $global:CUSTOM_COLUMN_MAP = @{}
    $global:CUSTOM_COLUMN_MAP.Add("DI_EBRW_CCR_BENCHMARK", 
        @{ "SourceColumnName" = "EBRW_CCR_BENCHMARK" }) | Out-Null
    $global:CUSTOM_COLUMN_MAP.Add("DI_MATH_CCR_BENCHMARK", 
        @{ "SourceColumnName" = "MATH_CCR_BENCHMARK" }) | Out-Null
    $global:CUSTOM_COLUMN_MAP.Add($DItestDateColumnName, 
        @{ "SourceColumnName" = $testDateColumnName }) | Out-Null
        $global:CUSTOM_COLUMN_MAP.Add($DIAssessIdentifierColumnName, 
        @{ "SourceColumnName" = $testDateColumnName }) | Out-Null
		   
    
}


# Process each individual line of incoming data (the pipeline sends this one line at a time)
process {
    $currentLineNumber += 1
    $global:statistics.rowsProcessed += 1

    # Make sure we got something
    if (!$line) { Write-Error "Line $currentLineNumber does not contain any data"; return }
    
    
    
    # If the first line pick out all of the headers
    if ($currentLineNumber -eq 1) { 

        # We assume headers will not have commas in the names
        #$headerRow = $parsedLine
        $headerRow = Get-ParsedRecordArray -line $line

        # Loop thru headers to find and fix empty and duplicate headers
        for ($i = 0; $i -lt $headerRow.Count; $i++) {
            $item = $headerRow[$i]
            $item = $item.Trim(' ')
            
            # handle empty headers
            if (!$item) {
                $newName = "EMPTY-$i"
                Write-Warning "Found empty column at position $($i + 1). Renaming column to '$newName'."
                $item = $newName
            }
            # handle duplicate headers
            if ($global:headersLookup[$item]) {
                $newName = "$item-$i"
                Write-Warning "Found duplicate column name of '$item' at position $($i + 1). Renaming column to '$newName'."
                $item = $newName
            }
            $global:inputHeaders += $item            
            $global:headersLookup.Add($item, $index) | Out-Null        
        }

        # Fixed Headers
        # Order matters, output values must be extracted in this same order
        # 1 - All columns needed from the file        
        $fixedHeaders = $global:inputHeaders

        
        # 2 - If there are custom headers add to output header line
        if ($global:CUSTOM_COLUMN_MAP.Count) {            
            $fixedHeaders += $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )
        }
        
        Write-Output $(Get-CSVLine($fixedHeaders))        
        return
    }

    
    # array, Ordered output values
    $orderedOutputValues = @()

    # HashTable, will hold all input values for current line, used in case computed columns need to reference input values
    $row = @{}
    
    # Not the cleanest of solutions, but none of the values should have double quotes, replace to remove wrapping quotes if present
    #$row = Get-ParsedRecord -headers $($global:inputHeaders) -line $line
    $row = ConvertFrom-Csv -InputObject $line -Header $global:inputHeaders

    # 1 - add all values as they come in line
    #$orderedOutputValues = $line.Split(",")
    $orderedOutputValues = Get-ParsedRecordArray -line $line   

   # Validation will tell whether or not a record has the required values needed to be posted to ODS, if not valid add line number to show in summary
   $passedValidation = $true
   $validationId = $null
    
    

    # Process custom/computed columns
    if ($global:CUSTOM_COLUMN_MAP.Count) {            
        foreach ($outColumnName in $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )) {
            $srcInfo = $global:CUSTOM_COLUMN_MAP[$outColumnName]                
            ### DataImport Assessment Custom Columns
            switch -Exact ($outColumnName) {
                
                # EBRW_CCR_BENCHMARK
                "DI_EBRW_CCR_BENCHMARK" {
                    $srcColName = $srcInfo.SourceColumnName
                    $col_EBRW = $row.$srcColName
                    $out_col_EBRW = $Null
                                     
                    if($col_EBRW -eq 'Y'){
                        $out_col_EBRW = "{0}/PerformanceLevelDescriptor#EBRW-MCCRB" -f $AssessNamespace
                    }else{
                        if($col_EBRW -eq 'N'){
                            $out_col_EBRW = "{0}/PerformanceLevelDescriptor#EBRW-NMCCRB" -f $AssessNamespace
                        }
                    }
                    # Validation, this is a required field, if empty will be unable to post to ODS
                    if (!$out_col_EBRW) {
                        $passedValidation = $false
                        $validationId = "Invalid_EBRW_CCR_BENCHMARK"
                        break
                    }
                    
            
                    $orderedOutputValues += $out_col_EBRW
                    break
                }
                
                # MATH_CCR_BENCHMARK
                "DI_MATH_CCR_BENCHMARK" {
                    $srcColName = $srcInfo.SourceColumnName
                    $col_MATH = $row.$srcColName
                    $out_col_MATH = $Null

                     if($col_MATH -eq 'Y'){
                        $out_col_MATH = "{0}/PerformanceLevelDescriptor#Math-MCCRB" -f $AssessNamespace
                    }else{
                        if($col_MATH -eq 'N'){
                            $out_col_MATH = "{0}/PerformanceLevelDescriptor#Math-NMCCRB" -f $AssessNamespace
                        }
                    }
                                     
                    # Validation, this is a required field, if empty will be unable to post to ODS
                    if (!$out_col_MATH) {
                        $passedValidation = $false
                        $validationId = "Invalid_MATH_CCR_BENCHMARK"
                        break
                    }
                    
            
                    $orderedOutputValues += $out_col_MATH
                    break
                }
                
                # School Year LATEST_PSAT_DATE
                { (  $_ -eq "DI_SchoolYear_LATEST_PSAT_DATE" ) -or ( $_ -eq "DI_SchoolYear_LATEST_SAT_DATE" ) }
                {
                    $srcColName = $srcInfo.SourceColumnName
                    $dateString = $row.$srcColName
                    $parsedDate = (Get-ParsedDate -date $dateString -inputFormat "M/d/yyyy" -outputFormat "M/d/yyyy") -as [datetime]
                    $schoolYear = $null
                    if ($parsedDate) {
                        if ($parsedDate.Month -ge 8) {
                            $schoolYear = $parsedDate.Year + 1
                        }
                        else {
                            $schoolYear = $parsedDate.Year
                        }
                    }
                                     
                    # Validation, this is a required field, if empty will be unable to post to ODS
                    if (!$schoolYear) {
                        $passedValidation = $false
                        $validationId = "InvalidSchoolYear"
                        break
                    }                    
            
                    $orderedOutputValues += $schoolYear
                    break
                }
                { (  $_ -eq "DI_StudentAssessmentIdentifier_LATEST_PSAT_DATE" ) -or ( $_ -eq "DI_StudentAssessmentIdentifier_LATEST_SAT_DATE" ) }
                {
                    $out_StudentAssessmentIdentifier = $null
                    $srcColName = $srcInfo.SourceColumnName
                    $dateString = $row.$srcColName
                    $out_StudentAssessmentIdentifier = (Get-ParsedDate -date $dateString -inputFormat "M/d/yyyy" -outputFormat "MMddyyyy")
                    
                    
                                     
                    # Validation, this is a required field, if empty will be unable to post to ODS
                    if (!$out_StudentAssessmentIdentifier) {
                        $passedValidation = $false
                        $validationId = "Invalid_StudentAssessmentIdentifier"
                        break
                    }                    
            
                    $orderedOutputValues += $out_StudentAssessmentIdentifier
                    break
                }


                Default {
                    # In case of no implementation for custom column add $null output to preserve output format and order
                    $orderedOutputValues += $null
                    break;
                }
            }

            
        }
    }        

    # If not valid add to statistics to notify user at the end of execution and skip record and do not post current for current row this screening period to ODS
    if (!$passedValidation) {
        
            Write-Warning "Invalid record see statistics summary for details.($currentLineNumber)"
               

        # Check if this validation error already added for current screening period
        if ($global:statistics.validations[$validationId]) {
            $global:statistics.validations[$validationId] += $currentLineNumber
        }
        else {
            $global:statistics.validations.Add($validationId, @($currentLineNumber)) | Out-Null
        }
        
        # Skip current line do not pass values to DataImport
        return
    }
    
    # Output 
    # Output 
    Write-Output $(Get-CSVLine($orderedOutputValues))
    $global:statistics.rowsLoaded ++    
    

    return
}

# end of processing
end {
     Write-Information "SUMMARY: `
                    Rows Processed: $($global:statistics.rowsProcessed); `
                    Rows Loaded: $($global:statistics.rowsLoaded)"

     foreach ($validationId in $global:statistics.validations.Keys) {
        Write-Warning "Error reason: '$validationId'"                
        Write-Information "Line number(s):"
        $lineNumbers = $global:statistics.validations[$validationId]
        $errorThreshold = 50
        if ($lineNumbers.Count -gt $errorThreshold) {
            Write-Warning "There are $($lineNumbers.Count) lines with errors. Will only print the first $errorThreshold line numbers where errors ocurred."
            $lineNumbers = $lineNumbers[0..$($errorThreshold - 1)]
        }
        Write-Warning "$([string]::Join(",",$lineNumbers))"
    }
}
